  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Missisquoi
  National Wildlife Refuge outlines Refuge accomplishments for the 1994 calendar year.
  The report begins with an introduction to the Refuge and describes climate and habitat
  conditions, and land acquisition. The planning section discusses the management
  plan and research and investigations. Administration topics are covered, including:
  personnel, volunteer programs, funding, and safety. Habitat management is covered;
  grasslands, wetlands, other habitats, grazing, haying, fire management, and pest
  control are discussed. The wildlife section of the report discusses endangered and
  threatened species, waterfowl, marsh and water birds, shore birds, raptors, other
  migratory birds, game mammals, other resident wildlife, animal control, and marking
  and banding. Interpretation and recreation activities are outlined; topics include
  outdoor classrooms, interpretive programs, hunting, fishing, trapping, wildlife
  observation, other wildlife oriented recreation, other non-wildlife oriented recreation,
  and law enforcement. The equipment and facilities section discusses rehabilitation,
  and equipment utilization and replacement. Cooperative programs and items of interest
  are discussed. Photographs and brochures are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
